  input: '"TEXT","F3XA","","This responds to your inquiry on 3/4/04 on these items:
    A. Documenting ANA-PAC''s ''best efforts'' to collect the employer/occupation
    information from individual contributors in excess of $200 aggregate in a calendar
    year. B. Amending 2003 Y.E. report for 7/1-12/31 listing employer/occupation information
    that was collected since the time the report was submitted. C. Clarifying terms
    ''fundraising expenses'' and ''fundraising event'' on schedule B and if they were
    used in connection with a specifically identified federal candidate. Item A: Documentation
    of ''Best Efforts'' Please find below ANA-PAC''s methodology for collecting ''employer''/''occupation''
    information. ANA-PAC collects most donations through our telemarketing program.
    1. Donation is requested of ANA members orally by the caller. If the member agrees
    to donate, the caller will ask the member to either verify or give the following
    information: member''s name, address, phone number, amount pledged, employer,
    and occupation. 2. Based on the phone call, the telemarketing company will then
    send a ''pledge donation card'' that contains the same information collected over
    the phone with the member. The donor then has the opportunity to make changes
    in writing to information on the pledge card that is incorrect, missing or changed
    since the time of the phone call. In addition, a disclaimer stating that ''employer''/''occupation''
    information is requested of the member per FEC regulations is stated on the pledge
    card. The member then sends the pledge card and their donation back to ANA. 3.
    Changes on the pledge card that members make in writing are entered into an ANA
    database. Changes to a member''s information that was taken orally during the
    telemarketing call are collected by the telemarketing company and sent in an electronic
    file to ANA and is uploaded in ANA''s membership database. 4. Changes made in
    the employer/occupation fields are recorded on FEC reports. Non-telemarketing
    donations are collected through: solicitation of members through ANA special events
    and promotions; solicitation of members on membership renewal notices; and solicitation
    for online donations in a secure ANA member area. 1. Through any of the three
    efforts listed above, the ''employer'' and ''occupation'' information is requested
    in writing on donation forms that are handed-out or attached with the request
    for donation from members. Also, a disclaimer is posted on the donor card requesting
    this information per FEC regulations. 2. If the ''employer''/''occupation'' information
    is not given and is not available in ANA''s membership database at the time of
    the donation, a follow-up phone call is placed to individual contributors giving
    $200 or more aggregate in a calendar year. 3. Information regarding ''employer''/''occupation''
    that is received is added to the ANA membership database and recorded on FEC reports.
    Item B: Amendments to the Y.E. Report of 7/1/03-12/31/03 Please find attached
    an upload of an amended year-end report containing ''employer''/''occupation''
    information that was ''requested'' and received for contributors giving $200 or
    more aggregate in a calendar year on schedule A, line 11A. Item C: Clarification
    of the terms ''fundraising expense''/''fundraising event'' Both of these terms
    were not used in connection with a federal candidate. The term ''fundraising expense''
    was used to describe a payment that was made by ANA-PAC to Membership Marketing
    Services, Inc for the cost of ANA-PAC''s telemarketing services and for Capitol
    Steps for entertainment at an ANA-PAC member fundraiser. The term ''fundraising
    event'' was used to describe a payment for a ticket to a fundraising event for
    a federal PAC that was not connected to a federal candidate. For questions, please
    call Rose Gonzalez at 202-651-7098."'
